import React from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link} from "react-router-dom";


class Managerheader1 extends React.Component {
    render() {
        function onItemClick(){
            window.location="/manager"
        }
        return (
            <BrowserRouter>
            <header>
                <div>
                    <nav>
                        <div className="">
                        <Link onClick={onItemClick} > <img style={{float:"left"}}  src={NINE} alt="nineleaps"/> </Link>

                           <Link onClick={onItemClick} style={{float:"right"}} >Logout</Link>
                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default Managerheader1
